import React from "react";
import { Header, Image, Container } from "semantic-ui-react";
/**
 * TODO: need svg of the logo with the name in it
 */
const Splash = () => (
  <div>
    <Header as="h1" style={{ backgroundColor: "#eac012", height: 90 }}>
      <Image circular src="./logo.jpg" />
    </Header>

    <Container style={{backgroundColor: 'yellow'}}>
      <Header
        style={{
          fontSize: "4em",
          fontWeight: "normal",
          marginBottom: 0,
          marginTop: "3em"
        }}
        as="h1"
      >
        Food at lightspeed.
      </Header>
      <Header as='h2'> 
          Forget waiting times and annoying lines.
      </Header>
    </Container>
  </div>
);

export default Splash;
